import React from "react";
import CartSummary from "./CartSummary";
import ShoppingCart from "./ShoppingCart";

const Cart = (props) => {
  const { products } = props;
  return (
    <React.Fragment>
      <div className="row">
        <ShoppingCart products={products} />
        <CartSummary />
      </div>
    </React.Fragment>
  );
};
export default Cart;
